// import { useHistory } from "react-router-dom";

const FavSongTableRow = ({ id, elem, handleDeleteSong, handleDirection }) => {
  // console.log(elem);
  let { bio, search } = elem;

  let avatar = bio.artists[0].strArtistThumb;

  // let history = useHistory();

  let avatarStyles = {
    height:"300px",
    width:"200px",
    // maxWidth: "100px",
    // maxHeight: "200px",
    cursor: "pointer",
    // objectFit: "cover",
    borderRadious:"20px",
    backgroundColor:"red",
    backgroundSize: "contain",
    position:"center",
    margin:"0",
  };

  return (
    <div style={avatarStyles}>
      <div  onClick={() => handleDirection(id)}>
        <img src={avatar} alt={search.artist} />
      </div>
      <p>{search.artist}</p>
      <p>{search.song}</p>

      {/* <button onClick={() => history.push(`/${id}`)}>See</button> */}
      <button onClick={() => handleDeleteSong(id)}>Delete</button>
      <br/>
      <br/>
      <br/>
      <br/>
    </div>
  );
};

export default FavSongTableRow;

